import Painting from "./Painting"

const Paintings = () => {
    const realisticPaintings = cardData.map(item => {
        return (
        <Painting
            key={item.id}
            item={item}
        />
        )
    }) 
    const abstractPaintings = cardData.map(item => {
        return (
        <Painting
            key={item.id}
            item={item}
        />
        )
    }) 
    const smallPaintings = cardData.map(item => {
        return (
        <Painting
            key={item.id}
            item={item}
        />
        )
    }) 

    return(
        <div>
            <h2>Art</h2>
            <p>Here are my paintings! </p>
            <h2>My Watercolors</h2>
            <h3>Realistic Watercolors</h3>
            <section className="paintings">
                {realisticPaintings}
            </section>

            <h3>Abstract Watercolors</h3>
            <section className="paintings">
                {abstractPaintings}
            </section>

            <h3>Small Watercolors</h3>
            <section className="paintings">
                {smallPaintings}
            </section>

        </div>
    )
}

export default <Paintings />;
